import React, {Component} from 'react';


class SearchResults extends Component {
    constructor() {
        super();

        this.state = {
            searchResults : []
        }


    }

    render() {

        const searchResults = this.props.searchResults.map((searcResult, i) =>{
            return (
                <div>
                    <h1>City Search Results</h1>
                </div>

            )
        })


        return (
            <div>THIS IS WHERE THE CITY SEARCH RESULTS WILL GO </div>
        )
    }
}

export default SearchResults;
